import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { Clock, FileText, Trophy, Play } from "lucide-react";
import api from "../utils/api";
import "./mytests.css"

export default function MyTests() {
  const [tests, setTests] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    fetchTests();
  }, []);

  const fetchTests = async () => {
    try {
      setLoading(true);
      setError(null);
      const response = await api.get("/tests");
      
      // Handle different response structures
      const testsData = response.data.tests || response.data || [];
      setTests(Array.isArray(testsData) ? testsData : []);
    } catch (err) {
      console.error("Error fetching tests:", err);
      setError("Failed to fetch tests. Please try again.");
      setTests([]);
    } finally {
      setLoading(false);
    }
  };

  const handleTakeTest = (test) => {
    navigate(`/take-test/${test._id}`, { state: { test } });
  };

  if (loading) {
    return (
      <div className="max-w-6xl mx-auto p-8">
        <div className="flex items-center justify-center min-h-64">
          <div className="text-xl text-gray-600">Loading tests...</div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="max-w-6xl mx-auto p-8">
        <div className="bg-red-50 border border-red-200 rounded-lg p-6">
          <h2 className="text-lg font-semibold text-red-800 mb-2">Error</h2>
          <p className="text-red-600">{error}</p>
          <button 
            onClick={fetchTests}
            className="mt-4 px-4 py-2 bg-red-600 text-white rounded-lg hover:bg-red-700 transition"
          >
            Try Again
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="max-w-6xl mx-auto p-8">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-800 mb-2">Available Tests</h1>
        <p className="text-gray-600">Choose a test to begin your assessment</p>
      </div>

      {tests.length === 0 ? (
        <div className="text-center py-12">
          <FileText size={64} className="mx-auto text-gray-400 mb-4" />
          <h2 className="text-xl font-semibold text-gray-600 mb-2">No Tests Available</h2>
          <p className="text-gray-500">Check back later for new tests.</p>
        </div>
      ) : (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {tests.map(test => (
            <TestCard key={test._id} test={test} onTakeTest={handleTakeTest} />
          ))}
        </div>
      )}
    </div>
  );
}

function TestCard({ test, onTakeTest }) {
  const questionCount = Array.isArray(test.questions) ? test.questions.length : 0;
  
  return (
    <div className="bg-white rounded-xl shadow-lg hover:shadow-xl transition-all duration-300 overflow-hidden border border-gray-100">
      <div className="p-6">
        <div className="mb-4">
          <h3 className="text-xl font-bold text-gray-800 mb-2">{test.name}</h3>
          <span className="inline-block px-3 py-1 bg-blue-100 text-blue-800 text-sm font-medium rounded-full capitalize">
            {test.category || 'Mixed'}
          </span>
        </div>

        <div className="space-y-3 mb-6">
          <div className="flex items-center text-gray-600">
            <Clock size={16} className="mr-3 text-blue-500" />
            <span className="text-sm">
              Duration: <strong className="text-gray-800">{test.duration || 0} minutes</strong>
            </span>
          </div>
          
          <div className="flex items-center text-gray-600">
            <Trophy size={16} className="mr-3 text-green-500" />
            <span className="text-sm">
              Total Marks: <strong className="text-gray-800">{test.totalMarks || 0}</strong>
            </span>
          </div>
          
          <div className="flex items-center text-gray-600">
            <FileText size={16} className="mr-3 text-purple-500" />
            <span className="text-sm">
              Questions: <strong className="text-gray-800">{questionCount}</strong>
            </span>
          </div>
        </div>

        <button
          onClick={() => onTakeTest(test)}
          className="w-full bg-gradient-to-r from-blue-600 to-blue-700 text-white py-3 px-4 rounded-lg font-semibold hover:from-blue-700 hover:to-blue-800 transition-all duration-200 flex items-center justify-center"
        >
          <Play size={16} className="mr-2" />
          Start Test
        </button>
      </div>
    </div>
  );
}
